cenario: Verify that the user deletion operation again after successful deletion with same userID\r\n  Given The userID is already deleted\r\n  When User sends DELETE request to delete the respective userID\r\n  Then User receives 404 Not Found error with the message\r\n\r\nScenario: Verify userID in response is deleted with requested userID\r\n  Given The userID is already deleted\r\n  When User sends DELETE request to delete the respective userID\r\n  Then Response body contains the same user_id as requested\r\n\r\nScenario: Verify that the user deletion operation with invalid userID (alphanumeric and special characters)\r\n  Given User enters userID with combination of number, alphabet and special characters\r\n  When User sends DELETE request to delete the respective userID\r\n  Then User receives 404 Not Found error with the message\r\n\r\nScenario: Verify that the user deletion operation with invalid userID (only special characters)\r\n  Given User enters userID with only special characters\r\n  When User sends DELETE request to delete the respective userID\r\n  Then User receives 404 Not Found error with the message\r\n\r\nScenario: Verify that the user deletion operation with non-existent userID\r\n  Given User enters userID with 5 invalid digits\r\n  When User sends DELETE request to delete the respective userID\r\n  Then User receives 404 Not Found error with the message\r\n\r\nScenario: Verify that the user deletion operation with blank userID\r\n  Given User enters userID with nothing (blank)\r\n  When User sends DELETE request to delete the respective userID\r\n  Then User receives 404 Not Found error with the message\r\n\r\nScenario: Verify that the user deletion operation with zero value userID\r\n  Given User enters userID with zero value\r\n  When User sends DELETE request to delete the respective userID\r\n  Then User receives 404 Not Found error with the message\r\n\r\nScenario: Verify that the user deletion operation with negative integer userID\r\n  Given User enters userID with negative value\r\n  When User sends DELETE request to delete the respective userID\r\n  Then User receives 404 Not Found error with the message\r\n\r\nScenario: Verify that the user deletion operation with out of range userID\r\n  Given User enters userID with out of range value\r\n  When User sends DELETE request to delete the respective userID\r\n  Then User receives 400 Bad Request with the message\r\n\r\nScenario: Verify the user deletion operation with invalid BaseURL\r\n  Given User enters userID with invalid BaseURL and valid Endpoint\r\n  When User sends DELETE request with the respective userID\r\n  Then User receives 404 Not Found error with the message\r\n\r\nScenario: Verify the user deletion operation with invalid Endpoint\r\n  Given User enters userID with valid BaseURL and invalid Endpoint\r\n  When User sends DELETE request with the respective userID\r\n  Then User receives 404 Not Found error with the message\r\n\r\nScenario: Verify the user deletion operation with empty Endpoint\r\n  Given User enters userID with valid BaseURL and empty Endpoint\r\n  When User sends DELETE request with the respective userID\r\n  Then User receives 404 Not Found error with the message","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/chand\/eclipse-workspace\/API_RESTASSURED\/src\/test\/resources\/Features\/Delete_Userid.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"User Deletion API - DELETE Request Scenarios","description":"","children":[{"scenario":{"location":{"line":3,"column":1},"tags":[],"keyword":"Scenario","name":"Verify that the user deletion operation is successful with existing userID","description":"","steps":[{"location":{"line":4,"column":3},"keyword":"Given ","keywordType":"Context","text":"The userID exists already","id":"cfea26e9-90e6-49c7-8eeb-1ab45731c4f7"},{"location":{"line":5,"column":3},"keyword":"When  User sends GET request with existing user FirstName\r\n  Then Response body contains same UserfirstName as requested\r\n\r\nScenario: Validate Response Body Content-Type is JSON\r\n  Given User prepares GET request with BaseURL, valid endpoint, and existing user FirstName\r\n  When User sends GET request with existing user FirstName\r\n  Then Response Content-Type is JSON with status code 200 OK\r\n\r\nScenario: Validate Required Fields in Response\r\n  Given User prepares GET request with BaseURL, valid endpoint, and existing user FirstName\r\n  When User sends GET request with existing user FirstName\r\n  Then Response contains user details: user_id, UserfirstName, UserlastName, userContactNumber, userEmailId, creationTime, lastModTime, userAddress, addressId, plotNumber, street, state, country, zipCode\r\n\r\nScenario: Validate FirstName is String Type\r\n  Given User prepares GET request with BaseURL, valid endpoint, and existing user FirstName\r\n  When User sends GET request with existing user FirstName\r\n  Then UserfirstName in response is of string type\r\n\r\nScenario: Validate address_id is integer type in response\r\n  Given User prepares GET request with BaseURL, valid endpoint, and existing user FirstName\r\n  When User sends GET request with existing user FirstName\r\n  Then address_id is of integer type\r\n\r\nScenario: Get User with Non-Existing FirstName\r\n  Given User prepares GET request with BaseURL, valid endpoint, and non-existing FirstName\r\n  When User sends GET request with non-existent FirstName\r\n  Then User receives 404 Not Found status with the error message\r\n\r\nScenario: Get User with Invalid FirstName Format (e.g. integer instead of string)\r\n  Given User prepares GET request with BaseURL, valid endpoint, and invalid FirstName as 123\r\n  When User sends GET request with invalid FirstName 123\r\n  Then User receives 404 Not Found status with the error message\r\n\r\nScenario: Get User with Invalid Endpoint\r\n  Given User prepares GET request with BaseURL and invalid endpoint path\r\n  When User sends GET request to wrong path\r\n  Then User receives 404 Not Found status with the error message\r\n\r\nScenario: Get User without Authorization\r\n  Given User prepares GET request with BaseURL, valid endpoint, and existing user FirstName but without Authorization header\r\n  When User sends GET request with existing user FirstName without Auth\r\n  Then User received 401 Unauthorized status","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/chand\/eclipse-workspace\/API_RESTASSURED\/src\/test\/resources\/Features\/Get_Userfirstname.feature","feature":{"location":{"line":2,"column":2},"tags":[],"language":"en","keyword":"Feature","name":"Get User by FirstName API - GET Request Scenarios","description":"","children":[{"scenario":{"location":{"line":4,"column":1},"tags":[],"keyword":"Scenario","name":"Get User by valid FirstName","description":"","steps":[{"location":{"line":5,"column":3},"keyword":"Given ","keywordType":"Context","text":"User prepares GET request with BaseURL, valid endpoint, and existing user FirstName","id":"d765251a-2379-47fc-af05-0d4a75cadcaa"},{"location":{"line":6,"column":3},"keyword":"When ","keywordType":"Action","text":"User sends GET request with existing user FirstName","id":"78d49c87-c685-416f-838b-0976bb07cd3c"},{"location":{"line":7,"column":3},"keyword":"Then ","keywordType":"Outcome","text":"User receives 200 OK status with user details in response","id":"1b9ef343-6d3b-47b2-959f-487a39732d84"}],"examples":[],"id":"116e606c-4828-46c0-bfa3-9a95ec054b8c"}},{"scenario":{"location":{"line":9,"column":1},"tags":[],"keyword":"Scenario","name":"Validate FirstName in Response Matches Requested FirstName","description":"","steps":[{"location":{"line":10,"column":3},"keyword":"Given ","keywordType":"Context","text":"User prepares GET request with BaseURL, valid endpoint, and existing user FirstName","id":"8345be45-727b-4975-b deIds":["01aa677e-f66a-417b-b32a-3969df155d4d"]}},{"source":{"uri":"file:\/\/\/C:\/Users\/chand\/eclipse-workspace\/API_RESTASSURED\/src\/test\/resources\/Features\/Get_Userid.feature","data":"Feature: Get User by ID API - GET Request Scenarios\r\n\r\nScenario: Get User by Valid ID\r\n  Given User prepares GET request with BaseURL, valid endpoint, and valid user ID\r\n  When User sends GET request with existing user ID\r\n  Then User receives 200 OK status with the user details in response\r\n\r\nScenario: Validate user_id in Response Matches Requested ID\r\n  Given User prepares GET request with BaseURL, valid endpoint, and valid user ID\r\n  When User sends GET request with existing user ID\r\n  Then Response body contains same user_id as requested\r\n\r\nScenario: Validate Response Body Content-Type is JSON\r\n  Given User prepares GET request with BaseURL, valid endpoint, and valid user ID\r\n  When User sends GET request with existing user ID\r\n  Then the Response Content-Type is JSON with status code 200 OK\r\n\r\nScenario: Validate Required Fields in Response\r\n  Given User prepares GET request with BaseURL, valid endpoint, and valid user ID\r\n  When User sends GET request with existing user ID\r\n  Then Response contains mandatory fields: user_id, UserfirstName, UserlastName, userContactNumber, userEmailId, creationTime, lastModTime, userAddress, addressId, plotNumber, street, state, country, zipCode\r\n\r\nScenario: Validate user_id is Integer Type\r\n  Given User prepares GET request with BaseURL, valid endpoint, and valid user ID\r\n  When User sends GET request with existing user ID\r\n  Then the user_id in response is of integer type\r\n\r\nScenario: Validate address_id is integer type in response\r\n  Given User prepares GET request with BaseURL, valid endpoint, and valid user ID\r\n  When User sends GET request with existing user ID\r\n  Then the address_id is of integer type\r\n\r\nScenario: Get User with Non-Existing ID\r\n  Given User prepares GET request with BaseURL, valid endpoint, and non-existing user ID\r\n  When User sends GET request with non-existent ID\r\n  Then User receives 404 Not Found status with an error message\r\n\r\nScenario: Get User with Invalid ID Format (e.g. string instead of integer)\r\n  Given User prepares GET request with BaseURL, valid endpoint, and invalid user ID 'abc'\r\n  When User sends GET request with invalid ID 'abc'\r\n  Then User receives 400 Bad Request status with an error message\r\n\r\nScenario: Get User with Invalid Endpoint\r\n  Given User prepares GET request with the BaseURL and invalid endpoint path\r\n  When User sends GET request to the wrong path\r\n  Then User receives 404 Not Found status with an error message\r\n\r\nScenario: Get User without Authorization\r\n  Given User prepares GET request with valid BaseURL, valid endpoint, and existing user ID but without Authorization header\r\n  When User sends GET request with existing user ID without Authorization\r\n  Then User receives the 401 Unauthorized status","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/chand\/eclipse-workspace\/API_RESTASSURED\/src\/test\/resources\/Features\/Get_Userid.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Get User by ID API - GET Request Scenarios","description":"","children":[{"scenario":{"location":{"line":3,"column":1},"tags":[],"keyword":"Scenario","name":"Get User by Valid ID","description":"","steps":[{"location":{"line":4,"column":3},"keyword":"Given ","keywordType":"Context","text":"User prepares GET request with BaseURL, valid endpoint, and valid user ID","id":"234413a5-de1a-42bf-b8d4-a2566c24f7ce"},{"location":{"line":5,"column":3},"keyword":"When ","keywordType":"Action","text":"User sends GET request with existing user ID","id":"0e617cd1-3f22-4e74-9fe0-925255a0eeda"},{"location":{"line":6,"column":3},"keyword":"Then ","keywordType":"Outcome","text":"User s 404 Not Found status\r\n\r\nScenario: Get Users with Empty Endpoint\r\n  Given User prepares the GET request with valid BaseURL and empty endpoint\r\n  When User sends GET request to fetch users\r\n  Then User receives 404 Not Found status\r\n\r\nScenario: Get USERS without Authorization and receives 401\r\n  Given User prepares the GET request without Authorization header\r\n  When User sends GET request to fetch users without Auth\r\n  Then User receives 401 Unauthorized status\r\n\r\nScenario: Get Users with Invalid Base URL\r\n  Given User prepares the GET request with invalid BaseURL and valid endpoint\r\n  When User sends GET request to fetch users\r\n  Then User receives 404 Not Found status with error message","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/chand\/eclipse-workspace\/API_RESTASSURED\/src\/test\/resources\/Features\/get.allusers.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Get All Users API - GET Request Scenarios","description":"","children":[{"scenario":{"location":{"line":3,"column":1},"tags":[],"keyword":"Scenario","name":"Get All Users with Valid Base URL and Endpoint","description":"","steps":[{"location":{"line":4,"column":3},"keyword":"Given ","keywordType":"Context","text":"User prepares the GET request with valid BaseURL and valid endpoint","id":"d7147ce9-44bb-45a0-a392-d26b57ebc036"},{"location":{"line":5,"column":3},"keyword":"When ","keywordType":"Action","text":"User sends GET request to fetch users","id":"473137c2-a1ac-41db-93ff-6365eaf29bd5"},{"location":{"line":6,"column":3},"keyword":"Then ","keywordType":"Outcome","text":"User receives 200 OK status with list of users","id":"f09ecd8b-71d5-4fc0-b538-765c5aaa05cd"}],"examples":[],"id":"889e8680-d7e9-42f8-bb03-d39764427090"}},{"scenario":{"location":{"line":8,"column":1},"tags":[],"keyword":"Scenario","name":"Validate Response Body Content-Type is JSON","description":
